const Course = ({ course}) => {
    const total = course.reduce(
        (a, b) => a + b.parts.exercises,
        0
    );
  
return (
    <div>
            {course.parts.map(index =>
        <ul key={index.id}>
        {index.name} {index.exercises}
         </ul>
            )} 
            total of {total} exercises
           
    </div>
)
}

export default Course
